import { getRateKor } from "../rate"
import { instanceKream } from "../services"


export const getSellHistory = async() => {
    const response = await instanceKream.get('https://kream.co.kr/api/p/products/12831/sales?cursor=1&per_page=50&sort=date_created[desc]&request_key=428133c9-cffe-44fd-8f39-e1b2f95b9a20')
    const data = response.data.items
    const rate = await getRateKor();
    return {
        size: parseInt(data.option),
        price: data.price
    }
}
